 eine Webseite besuchen. Kehren Sie auf die gleiche Webseite zur&uuml;ck, werden diese Cookies wieder an die Webseite geschickt.</p>\\r\\n\\r\\n<p>Die &quot;technischen Cookies&quot; werden u.a. f&uuml;r informatische Authentifizierungen, Aufzeichnung von Sitzungen und Speicherung von Informationen auf der Webseite verwendet (ohne die Verwendung von &quot;technischen Cookies&quot; w&auml;ren bestimmte Vorg&auml;nge auf der Webseite nicht m&ouml;glich).</p>\\r\\n\\r\\n<p>Die &quot;Tracking-Cookies&quot; (oder &quot;Profilierungs-Cookies&quot;) erlauben hingegen die Identifizierung von User-Profilen und werden verwendet um personalisierte Werbung zu schalten.</p>\\r\\n\\r\\n<p>Die Cookies k&ouml;nnen zudem in &quot;dauerhafte&quot; und &quot;Sitzungs-Cookies&quot; unterteilt werden. Die Sitzungs-Cookies werden automatisch von Ihrem Computer entfernt, sobald Sie den Browser schlie&szlig;en. Die dauerhaften Cookies bleiben auf Ihrem Computer gespeichert und werden erst entfernt, wenn sie ihr Ablaufdatum erreicht haben oder manuell gel&ouml;scht werden. Einige Cookies, die auf der Webseite verwendet werden, stammen von Drittanbietern.</p>\\r\\n\\r\\n<p>Um eine optimale Web-Navigation zu bieten, k&ouml;nnte die besuchte Webseite von allen oder von einem Teil der folgenden, eigenen und/oder von Dritten stammenden, Cookies Gebrauch machen:</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p><strong>Sitzungs-Cookie (lokal)</strong><br />\\r\\nEs handelt sich um einen technischen Cookie mit einer Speicherfunktion der Handlungen des Benutzers innerhalb einer Webseite. Dieser wird beim Verlassen der Webseite gel&ouml;scht. Sollte es sich um eine E-Commerce-Webseite handeln, wird dieser Cookie auch dazu verwendet, die in den Warenkorb gelegten Produkte zu speichern.</p>\\r\\n\\r\\n<p><strong>Google Analytics (von Dritten)</strong><br />\\r\\n&Uuml;berwachende Cookies f&uuml;r die Entwicklung von Statistiken der Webseitenverwendung; Google Analytics verwendet Cookies, die keine personenbezogenen Daten speichern und die auf dem PC des Benutzers abgelegt werden, um dem Anbieter der Webseite die M&ouml;glichkeit zu geben, Analysen zu erstellen, wie die gleichen Benutzer die Webseite benutzen. Um die Speicherung der hier vorher genannten Cookies zu verhindern, muss der Benutzer dem Vorgang in diesem Link folgen: http://www.google.com/intl/de_ALL/analytics/learn/privacy.html</p>\\r\\n\\r\\n<p><strong>Facebook (von Dritten)</strong><br />\\r\\nDiese Cookies werden verwendet, um die Werbung zu erarbeiten und zu verbessern d.h. mit Marketingstrategien, um dem Benutzer Nachrichten im Sinne seines Interesses zusenden zu k&ouml;nnen. Zus&auml;tzliche Informationen, auch in Bezug mit der Modalit&auml;t, mit der diese oben genannten Cookies deaktiviert werden k&ouml;nnen, sind im folgenden Link herunterladbar: https://www.facebook.com/help/cookies/ Um die Cookies anzuhaken/abzuhaken hier klicken: http://www.youronlinechoices.com/de/praferenzmanagement/</p>\\r\\n\\r\\n<p><strong>Adwords (von Dritten)</strong><br />\\r\\nDiese Cookies werden verwendet, um die Werbung zu erarbeiten und zu verbessern d.h. mit Marketingstrategien, um dem Benutzer Nachrichten im Sinne seines Interesses zusenden zu k&ouml;nnen. Zus&auml;tzliche Informationen, auch in Bezug mit der Modalit&auml;t, mit der diese oben genannten Cookies deaktiviert werden k&ouml;nnen, sind im folgenden Link herunterladbar: https://support.google.com/adwords/answer/2407785?hl=de um die Cookies anzuhaken/abzuhaken hier klicken: http://www.google.com/settings/ads</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p><strong>Wie k&ouml;nnen Cookies deaktiviert, gel&ouml;scht oder blockiert werden.</strong></p>\\r\\n\\r\\n<p>Diese von Ihnen besuchte Webseite erm&ouml;glicht die einzelnen Cookies, mit den hier folgend illustrierten Modalit&auml;ten anzuhaken/abzuhaken, jedoch mit dem Hinweis, dass im Falle einer Deaktivierung, die vollst&auml;ndige Nutzung der Webseite nicht mehr garantiert werden kann.</p>\\r\\n\\r\\n<p><strong>Firefox:</strong>&nbsp;</p>\\r\\n\\r\\n<p>&Ouml;ffnen Sie den Firefox Browser.<br />\\r\\nDr&uuml;cken Sie die &bdquo;Alt&ldquo; Taste auf Ihrer Tastatur.<br />\\r\\nW&auml;hlen Sie &bdquo;Men&uuml;&ldquo; und dann &bdquo;Optionen&ldquo; in Ihrer Funktionsleiste.<br />\\r\\nW&auml;hlen Sie den Reiter &bdquo;Privatsph&auml;re&ldquo; aus.<br />\\r\\nW&auml;hlen Sie f&uuml;r &bdquo;Firefox wird eine Chronik:&ldquo; &bdquo;nach benutzerdefinierten Einstellungen anlegen&ldquo; aus.<br />\\r\\nEntfernen Sie die Markierung &bdquo;Cookies akzeptieren&ldquo; und speichern Sie Ihre Einstellungen.</p>\\r\\n\\r\\n<p><strong>Internet Explorer:</strong><br />\\r\\n&Ouml;ffnen Sie den Internet Explorer.<br />\\r\\nKlicken Sie auf die Schaltfl&auml;che &bdquo;Extras&ldquo; und dann auf &bdquo;Internetoptionen&ldquo;.<br />\\r\\nKlicken Sie auf die Registerkarte &bdquo;Datenschutz&ldquo;.<br />\\r\\nIm Reiter &bdquo;Cookies&ldquo; k&ouml;nnen Sie die Markierung entfernen und Ihre Einstellungen speichern.</p>\\r\\n\\r\\n<p><strong>Google Chrome:&nbsp;</strong><br />\\r\\n&Ouml;ffnen Sie Google Chrome.<br />\\r\\nW&auml;hlen Sie &ldquo;Einstellungen&rdquo; aus.<br />\\r\\nKlicken Sie auf &ldquo;Erweiterte Einstellungen anzeigen&rdquo;.<br />\\r\\nKlicken Sie im Reiter &bdquo;Datenschutz&ldquo; auf &bdquo;Inhaltseinstellungen&ldquo;.<br />\\r\\nIm Abschnitt &bdquo;Cookies&ldquo; k&ouml;nnen Sie diese deaktivieren und Ihre Einstellungen speichern.</p>\\r\\n\\r\\n<p><strong>Safari:&nbsp;</strong><br />\\r\\n&Ouml;ffnen Sie Safari.<br />\\r\\nW&auml;hlen Sie &bdquo;Einstellungen&ldquo; in der Funktionsliste (graues Zahnrad in der oberen, rechten Ecke) und klicken Sie auf &bdquo;Privatsph&auml;re&ldquo;.<br />\\r\\nUnter &bdquo;Cookies akzeptieren&ldquo; k&ouml;nnen Sie spezifizieren ob und wann Safari Cookies von Websites akzeptieren soll. F&uuml;r mehr Informationen klicken Sie auf Hilfe (?).<br />\\r\\nWenn Sie mehr &uuml;ber die Cookies erfahren m&ouml;chten, die auf Ihrem Computer gespeichert werden, dann klicken Sie auf &bdquo;Cookies anzeigen&ldquo;.</p>\\r\\n\", \"subtitle\": null, \"title\": \"Informationen zur Verwendung von Cookies\", \"abstract\": null, \"display\": null, \"columns\": 1}, \"model\": \"flex.flextext\", \"pk\": 51}]','Informationen zur Verwendung von Cookies',45,70,'default'),(858,'51','json','[{\"fields\": {\"changed_date\": \"2016-11-04T09:56:05Z\", \"language\": \"de\", \"parent\": null, \"numchild\": 0, \"creation_date\": \"2016-11-04T09:56:05Z\", \"depth\": 1, \"position\": 0, \"path\": \"000P\", \"placeholder\": 4, \"plugin_type\": \"FlexTextPlugin\"}, \"model\": \"cms.cmsplugin\", \"pk\": 51}]','51',15,70,'default'),(859,'4','json','[{\"fields\": {\"slot\": \"content\", \"default_width\": null}, \"model\": \"cms.placeholder\", \"pk\": 4}]','content',1,70,'default'),(860,'13','json','[{\"fields\": {\"navigation_extenders\": null, \"site\": 1, \"application_namespace\": null, \"path\": \"0009\", \"in_navigation\": false, \"reverse_id\": null, \"login_required\": false, \"created_by\": \"maisengasse\", \"languages\": \"de\", \"publication_end_date\": null, \"template\": \"INHERIT\", \"placeholders\": [4], \"changed_date\": \"2016-11-04T09:36:08Z\", \"limit_visibility_in_menu\": null, \"parent\": null, \"numchild\": 0, \"soft_root\": false, \"is_home\": false, \"publication_date\": \"2016-11-04T09:36:08Z\", \"creation_date\": \"2016-11-04T09:35:58Z\", \"application_urls\": null, \"changed_by\": \"maisengasse\", \"xframe_options\": 0, \"depth\": 1, \"revision_id\": 0}, \"model\": \"cms.page\", \"pk\": 13}]','Cookie-Information',2,70,'default'),(861,'13','json','[{\"fields\": {\"menu_title\": \"\", \"meta_description\": \"\", \"page_title\": \"\", \"language\": \"de\", \"title\": \"Cookie-Information\", \"has_url_overwrite\": false, \"redirect\": null, \"page\": 13, \"published\": true, \"path\": \"cookies\", \"creation_date\": \"2016-11-04T09:35:58Z\", \"slug\": \"cookies\"}, \"model\": \"cms.title\", \"pk\": 13}]'